  {
    id: 1,
    text: "study",
    day: "Tuesday",
    reminder: false,
  },
  {
    id: 2,
    text: "gym",
    day: "Saturday",
    reminder: true,
  },
  {
    id: 3,
    text: "work",
    day: "Monday",
    reminder: true,
  },
];

const Tasks = () => {
  return (
    <>
      {tasks.map((task) => {
        {
          task.text;
        }
      })}
    </>
  );
};

export default Tasks;
